import React from 'react';

function Search(){
    return  <div class="input-group rounded">
    <input type="search" class="form-control rounded"  style={{"margin-top": "45px"}} placeholder="Search" aria-label="Search" aria-describedby="search-addon" />
    <span class="input-group-text border-0" id="search-addon">
      <i class="fas fa-search"></i>
    </span>
  </div>
}

export default Search;
